import "./css/Melchiott.css"
import portrait from "./img/DSC_7584.jpg"


function Melchiott() {
  return (
    <div className="melchiott">

      <h2>Who is Melchiott? / メルキオットはどなた様ですか？</h2>

      <p>Melchiott was born in China. Melchiott has been exposed to landscape photography since middle 
        school, and once photographed the starry sky in Kanas, Xinjiang. 
        Influenced by Hayao Miyazaki's film "The Wind Rises", Melchiott gradually became 
        interested in aviation vehicles and began to learn Japanese by himself. 
        When Melchiott was a student, he participated in air shows many times, and sometimes went to nearby civil airports to photograph civil aviation airliners. At the DUXford Air Show, melchiott shot for the first time with the newly purchased "sigma 100-400mm f5-6.3 dg os contemporary" lens. This lens brought back many memories for him. 
        He currently lives in Massachusetts, USA, and is a student at Northeastern University.</p>
      <p>On this site, you wil3232r Museum, and profiles of the photographer.</p>

      <div className="melchiott-photo-div">
        <img className="melchiott-photo" src={portrait}
          alt="A photo of melchiott and the pilot who maneuver the aircraft" />
      </div>

    </div>

  );
}

export default Melchiott;
